// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SeedHub {

    /// event

    uint public lotId;
    address public owner;    

    mapping(uint => Seed) internal seeds;
    mapping(uint => bool) internal newVariety;

    struct Seed {
        uint32 grams;
        // uint32 uint16(seedBalance); can I change just in function??
        uint32 seedBalance;
        uint lotID;
        string seedClass;
        string variety;        
    }

    event NewVariety(string indexed message);

    function addNewSeed(
        string memory class,
        string memory _variety,
        uint32 weight
    ) 
        public 
        returns (bool) 
    {
        seeds[lotId] = Seed({
            grams: weight,
            seedBalance: weight,
            lotID: lotId,
            seedClass: class,
            variety: _variety
        });    

          emit NewVariety("new variety added");
          return true;

        }

}
